import React, { Fragment } from "react";
import Breadcrumb from "../common/breadcrumb";
import data from "../../assets/data/listVendor";
import Datatable from "../common/datatable";
import MaterialTable from "material-table";
import { Card, CardBody, CardHeader, Container } from "reactstrap";
import CancelIcon from '@material-ui/icons/Cancel';
import EditIcon from '@material-ui/icons/Edit';

const List_vendors = () => {
	const [listClientes, setListClientes] = useState([]);

	const onOpenModal = () => {
		setOpen(true);
	};

	const onCloseModal = () => {
		setOpen(false);
	};

	useEffect(() => {
		let data = JSON.parse(localStorage.getItem('datosentorno'));
		//console.log("DATA PROVEEDORES: ", JSON.parse(data))
		//console.log("DATA UNO : ", data.vgl_condicionproducto);
		setListClientes(data.vgl_clientes);
		//console.log("CLIENTES : ", data.vgl_categorias)
	}, []);

	const seleccionarOrden = (orden, caso) => {

	}

	const columnas = [
		{
			field: 'identificacion',
			title: 'Identificación',
			cellStyle: { minWidth: 50 }
		},
		{
			field: 'tipoidentificacion',
			title: 'Tipo',
			cellStyle: { minWidth: 50 }
		},
		{
			field: 'primernombre',
			title: 'Nombre',
			cellStyle: { minWidth: 50 }
		},
		{
			field: 'segundonombre',
			title: 'segundonombre',
			cellStyle: { minWidth: 200 }
		},
		{
			field: 'nombreestado',
			title: 'Estado',
			cellStyle: { minWidth: 50 }
		}
	]
	
	return (
		<Fragment>
			<Breadcrumb title="Listar Vendedores" parent="Vendors" />
			<Container fluid={true}>
				<Card>
					<CardHeader>
						<h5>Información Vendedores</h5>
					</CardHeader>
					<CardBody>
						<div className="clearfix"></div>
						<div
							id="batchDelete"
							className="category-table user-list order-table coupon-list-delete"
						>
							<Datatable
								multiSelectOption={true}
								myData={data}
								pageSize={10}
								pagination={true}
								class="-striped -highlight"
							/>
						</div>
					</CardBody>
				</Card>
			</Container>
		</Fragment>
	);
};

export default List_vendors;
